function simplifyfactor(numerator, denominator) {
    var gcd = function gcd(a, b) {
        return b ? gcd(b, a % b) : a;
    };
    gcd = gcd(numerator, denominator);
    return numerator == 0 ? "" : (numerator / gcd) + "/" + (denominator / gcd);
}
function float2rat(x) {
    var tolerance = 1.0E-6;
    var h1 = 1; var h2 = 0;
    var k1 = 0; var k2 = 1;
    var b = x;
    do {
        var a = Math.floor(b);
        var aux = h1; h1 = a * h1 + h2; h2 = aux;
        aux = k1; k1 = a * k1 + k2; k2 = aux;
        b = 1 / (b - a);
    } while (Math.abs(x - h1 / k1) > x * tolerance);

    return h1 + "/" + k1;
}
function calcCirclePath(a, b, c) {
    var A = dist(b, c);
    var B = dist(c, a);
    var C = dist(a, b);
    var angle = Math.acos((A * A + B * B - C * C) / (2 * A * B));
    //calc radius of circle
    var K = .5 * A * B * Math.sin(angle);
    var r = A * B * C / 4 / K;
    r = Math.round(r * 1000) / 1000;
    //large arc flag
    var laf = +(Math.PI / 2 > angle);
    //sweep flag
    var saf = +((b[0] - a[0]) * (c[1] - a[1]) - (b[1] - a[1]) * (c[0] - a[0]) < 0);
    var path = ['M', a, 'A', r, r, 0, laf, saf, b].join(' ');
    return path;
}
function dist(a, b) {
    return Math.sqrt(Math.pow(a[0] - b[0], 2) + Math.pow(a[1] - b[1], 2))
}
function rounded_rect(x, y, w, h, r, tl, tr, bl, br) {
    var retval;
    retval = "M" + (x + r) + "," + y;
    retval += "h" + (w - 2 * r);
    if (tr) { retval += "a" + r + "," + r + " 0 0 1 " + r + "," + r; }
    else { retval += "h" + r; retval += "v" + r; }
    retval += "v" + (h - 2 * r);
    if (br) { retval += "a" + r + "," + r + " 0 0 1 " + -r + "," + r; }
    else { retval += "v" + r; retval += "h" + -r; }
    retval += "h" + (2 * r - w);
    if (bl) { retval += "a" + r + "," + r + " 0 0 1 " + -r + "," + -r; }
    else { retval += "h" + -r; retval += "v" + -r; }
    retval += "v" + (2 * r - h);
    if (tl) { retval += "a" + r + "," + r + " 0 0 1 " + r + "," + -r; }
    else { retval += "v" + -r; retval += "h" + r; }
    retval += "z";
    return retval;
}
